import React from "react";
import "./right.css";
import { Select } from 'antd';
const { Option } = Select;

export default class Down extends  React.Component {
    constructor(props) {
        super(props);
        this.state = {
            
	   };
    }

    render() {
        return (
		
        
			       <div className="taskBasicInformation">
						<div className="basicInformationContents">
							<span>类型：&nbsp;&nbsp;&nbsp;
								<Select style={{width: '50%'}} size="small" placeholder="请选择">
									<Option value="level0">全部</Option>
									<Option value="level1">社会安全</Option>
									<Option value="level2">公共安全</Option>
									<Option value="level3">自然灾害</Option>
									<Option value="level4">事故灾害</Option>
									<Option value="level5">文物安全</Option>
									<Option value="level6">其他事件</Option>
								</Select>
							</span>
							<span>等级：&nbsp;&nbsp;&nbsp;
								<Select style={{width: '50%'}} size="small" placeholder="请选择">
									<Option value="level1">全部</Option>
									<Option value="level2">一般</Option>
									<Option value="level3">较大</Option>
									<Option value="level4">重大</Option>
									<Option value="level5">特别大</Option>
								</Select>
							</span>
						</div>
						<div className="basicInformationContents">
							<span>状态：&nbsp;&nbsp;&nbsp;
									<Select style={{width: '50%'}} size="small" placeholder="请选择">
										<Option value="level1">全部</Option>
										<Option value="level2">应急</Option>
										<Option value="level3">待评估</Option>
										<Option value="level4">归档</Option>
									</Select>
							</span>
							<span>名称：&nbsp;&nbsp;&nbsp;<input /></span>
						</div>
                        <button> 查询</button>
                  
				</div>
        
		
        )
    }
}
